import React from "react";
import '../Game.css'

const GameCircle = ({id, children, handleClick}) => {
    //console.log("GameCircle", id, color);

    return (<div className={`gameCircle ${id%2===0? "odd":"even"}`}  onClick={(id)=>handleClick(id)}> 
        {children}
         </div>
         )
}

export default GameCircle;
